    // (new ArrayList<Long>(Arrays.asList((long)5l)))
    // >>> filterIntegers((new ArrayList<Object>(Arrays.asList(1l, 2l, 3l, "abc", new HashMap<Long,Long>(Map.of()), new ArrayList<Long>(Arrays.asList())))))
    // (new ArrayList<Long>(Arrays.asList((long)1l, (long)2l, (long)3l)))
    public static ArrayList<Long> filterIntegers(ArrayList<Object> values) {
        // All integers are of type Long, Float, Double, Integer, Byte, Short, and Char
        // All strings are of type String
        ArrayList<Long> out = new ArrayList<Long>();
        for(Object obj : values) {
            if(obj.getClass().isAssignableFrom(ArrayList.class)) {
                out.addAll(filterIntegers((ArrayList<Object>) obj));
            } else if(obj.getClass().isAssignableFrom(HashMap.class)) {
                for(Object o : (ArrayList<Object>)((HashMap<Object, Object>) obj).values()) {
                    out.addAll(filterIntegers((ArrayList<Object>) o));
                }
            } else if(obj.getClass().isAssignableFrom(String.class)) {
                try {
                    out.add(Long.parseLong((String) obj));
                } catch(NumberFormatException e) {}
            } else if(obj.getClass().isAssignableFrom(Long.class) || obj.getClass().isAssignableFrom(Float.class) || obj.getClass().isAssignableFrom(Double.class) || obj.getClass().isAssignableFrom(Integer.class) || obj.getClass().isAssignableFrom(Byte.class) || obj.getClass().isAssignableFrom(Short.class) || obj.getClass().isAssignableFrom(Character.class)) {
                out.add((Long) obj);
            }
        }
        return out;

